import "./ExpenseItemList.css";
import ExpenseItem from "./ExpenseItem";
import ExpenseFilter from "./ExpensesFilter";
import Card from "../UI/Card";

function ExpenseItemList(props) {
  const expenseItemsJsx = [];

  const filteredYearHandler=(chosenYear)=>{
      const yearToFilter=chosenYear;
      console.log(yearToFilter);
  };

  for (let index = 0; index < props.expenseItems.length; index++) {
    const element = props.expenseItems[index];
    expenseItemsJsx.push(
      <ExpenseItem
        title={element.title}
        amount={element.amount}
        date={element.date}
      />
    );
  }

  return (
    <div>
      <ExpenseFilter onSelectedYear={filteredYearHandler}/>
      <Card className="expenses">{expenseItemsJsx}</Card>
    </div>
  );
}

export default ExpenseItemList;
